import React from "react";
import Theme from "./theme";
import CocktailBrowser from "./components/CocktailBrowser";
import CocktailPage from "./components/CocktailPage";
import Bar from "./components/Bar";
import Settings from "./components/Settings";
import { BrowserRouter as Router, Route } from "react-router-dom";
import Topbar from "./components/Topbar";

function App() {
  return (
    <Theme>
      <Router>
        <Topbar />
        {
          // Routes
        }
        <Route exact path={["/ports/27212/", "/ports/27212/cocktails"]} component={CocktailBrowser} />
        <Route path={"/ports/27212/cocktails/:slug"} component={CocktailPage} />
        <Route path="/ports/27212/my-bar" component={Bar} />
        <Route path="/ports/27212/settings" component={Settings} />
      </Router>
    </Theme>
  );
}

export default App;
